  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:19.599300\",\n\t\"name\": \"long-lake-national-wildlife-refuge-and-long-lake-wetland-management-district-annual-narrat-d2f66\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Long Lake
  National Wildlife Refuge, Long Lake Wetland Management District, and the easement
  refuges outlines Refuge accomplishments during the 1990 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  public participation, and research and investigations. Refuge administration is
  outlined; information about personnel, volunteer programs, funding, safety, and
  technical assistance is given. Habitat management is also covered; subjects include
  wetlands, forests, croplands, grasslands, other habitats, grazing, haying, fire
  management, pest control, and water rights. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, game mammals, other resident wildlife, fisheries
  resources, wildlife propagation and stocking, animal control, marking and bird banding,
  and disease prevention and control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, fishing, trapping,
  wildlife observation, other wildlife oriented recreation, picnicking, other non-wildlife
  oriented recreation, and law enforcement. The equipment and facilities section of
  the report provides information about new construction, rehabilitation, major maintenance,
  and equipment utilization and replacement.\",\n\t\"license_title\": \"License Not
